      SELECT + - col2 * - + col1 * + + col2 - - col1 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL IS NULL AND ( NULL ) BETWEEN + ( - col2 ) AND - col0;
  - name: tab1

outputs:
  - name: q8644.out
    data: |
